function ProductDetails({ product }) {
  if (!product) return null;

  return (
    <div>
      <h2>{product.title}</h2>
      <img src={product.image} alt={product.title} />
      <p>Price: ${product.price}</p>
    </div>
  );
}

export default ProductDetails;
